(window.webpackJsonp=window.webpackJsonp||[]).push([[12],{254:function(module,exports){eval('\nmodule.exports = { \n      attributes: {"title":"Iniciando con Rust","year":2020,"month":6,"day":19,"hour":"00:58","excerpt":"Rust es un lenguaje de programaci칩n que ha estado creciendo en popularidad y con buenas razones, he decidido probarlo y te comparto un breve res칰men de este lenguaje y algunas de mis opiniones respecto a este lenguaje","picture":"/images/blog/rust_getting_started/Rust.png"},\n    \n      html: "<p>Un lenguaje que ha estado tomando much칤sima fuerza es <a href=\\"https://rust-lang.org\\">Rust</a> y esto lleva varios a침os,\\nbasta con ver la developer survey de <a href=\\"https://insights.stackoverflow.com/survey/2019#technology-_-most-loved-dreaded-and-wanted-languages\\">Stack Overflow</a> del 2019 para ver que es un lenguaje muy querido por los desarrolladores.</p>\\n<p>Ahora bien, 쯤u칠 tiene de especial este lenguaje de programaci칩n?, 춰pues mucho!, Rust est치 dise침ado para ser un lenguaje de programaci칩n de sistemas\\n(en la misma categor칤a que C, C++, D, Go), pero tiene algunas caracter칤sticas muy interesantes:</p>\\n<ul>\\n<li>Est치 dise침ado para ser seguro</li>\\n<li>Est치 dise침ado para ser concurrente</li>\\n<li>No tiene recolector de basura</li>\\n</ul>\\n<p>Y, desde mi punto de vista, es un lenguaje que ha venido para quedarse y creo que la etiqueta de &quot;moderno&quot; le queda muy bien :)</p>\\n<h1>Contenido</h1>\\n<ol>\\n<li><a href=\\"#history\\">Breve historia del lenguaje</a> 游닀</li>\\n<li><a href=\\"#install\\">Instalando Rust</a> 游눻</li>\\n<li><a href=\\"#hello-world\\">춰Hola mundo!</a> 游깵</li>\\n<li><a href=\\"#thoughts\\">Mis opiniones</a> 游뱂</li>\\n</ol>\\n<br>\\n<h1 id=\\"history\\">Breve historia del lenguaje</h1>\\n<p>Rust inicio como un proyecto personal de Graydon Hoare y se mantuvo de esta forma durante tres a침os, no fue sino hasta 2009 que Mozilla se iteres칩 en el proyecto\\ny se meti칩 al desarrollo de este proyecto.</p>\\n<p>En 2010 Mozilla dio a conocer este proyecto al p칰blico y este mismo a침o se empez칩 a implementar el compilador de Rust en Rust, anteriormente estaba escrito en OCaml y\\nfue hasta 2011 que por fin <code>rustc</code> pudo compilarse a si mismo :)</p>\\n<p>La primera versi칩n alfa de Rust sali칩 en 2012 y la primera versi칩n estable sali칩 hasta 2015 游꿀</p>\\n<p>La versi칩n m치s nueva a d칤a de hoy es la 1.44.0</p>\\n<br>\\n<h1 id=\\"install\\">Instalando Rust</h1>\\n<p>El proceso de instalaci칩n de Rust es muy sencillo, basta con descargar <a href=\\"https://www.rust-lang.org/tools/install\\">rustup</a> de la p치gina oficial,\\nen el caso de Windows (que es el sistema operativo que utilizo principalmente), abrir치 una ventana y tendr치 el siguiente contenido:</p>\\n<pre class=\\"language-cmd\\"><code class=\\"language-cmd\\">Current installation options:\\n\\n\\n   default host triple: x86_64-pc-windows-msvc\\n     default toolchain: stable\\n               profile: default\\n  modify PATH variable: yes\\n\\n1) Proceed with installation (default)\\n2) Customize installation\\n3) Cancel installation\\n</code></pre>\\n<p>Podemos personalizar varias cosas, una de las principales es el host triple, el host triple sirve para indicar las siguientes cosas:</p>\\n<ul>\\n<li>Arquitectura 游끹</li>\\n<li>Sistema operativo 游</li>\\n<li>Otras cuestiones, como utilizar msvc o gnu en el caso de Windows o utilizar glibc o musl en Linux 游댢\\nY para instalarlo basta con escribir <code>1</code> y presionar <code>ENTER</code></li>\\n</ul>\\n<br>\\n<p>Y si queremos actualizar Rust, el proceso es muy sencillo, pues basta con ejecutar el siguiente comando: 游녤 <code>rustup update</code></p>\\n<br>\\n<h1 id=\\"hello-world\\">춰Hola mundo!</h1>\\n<p>Escribir un hola mundo en Rust es muy sencillo, pues contamos con la herramienta <em>cargo</em>, cargo es el build system y gestor de paquetes de Rust,\\ncon el podemos gestionar dependencias y compilar nuestro c칩digo.</p>\\n<p>Para crear un proyecto con cargo, basta con ejecutar el siguiente comando:</p>\\n<pre class=\\"language-powershell\\"><code class=\\"language-powershell\\">cargo new <span class=\\"token namespace\\">[nombre del proyecto]</span>\\n</code></pre>\\n<p>Esto crear치 una carpeta con el nombre del proyecto, vayamos creando uno llamado &quot;hola_mundo&quot;:</p>\\n<pre class=\\"language-powershell\\"><code class=\\"language-powershell\\"><span class=\\"token function\\">PS</span> C:\\\\rust> cargo new hello_world\\nCreated binary <span class=\\"token punctuation\\">(</span>application<span class=\\"token punctuation\\">)</span> `hola_mundo` package\\n<span class=\\"token function\\">PS</span> C:\\\\rust> cd hello_world\\n<span class=\\"token function\\">PS</span> C:\\\\rust\\\\hello_world>\\n</code></pre>\\n<p>Cargo habr치 creado los siguientes archivos:</p>\\n<ul>\\n<li>.gitignore</li>\\n<li>Cargo.toml 游녣 aqu칤 es donde van las dependencias y algunos datos del proyecto</li>\\n<li>src/main.rs 游녣 nuestro c칩digo</li>\\n</ul>\\n<p>Analicemos el archivo <code>Cargo.toml</code> y <code>main.rs</code></p>\\n<p>Cargo.toml</p>\\n<pre class=\\"language-toml\\"><code class=\\"language-toml\\"><span class=\\"token punctuation\\">[</span><span class=\\"token table class-name\\">package</span><span class=\\"token punctuation\\">]</span>\\n<span class=\\"token key property\\">name</span> <span class=\\"token punctuation\\">=</span> <span class=\\"token string\\">\\"hola_mundo\\"</span>\\n<span class=\\"token key property\\">version</span> <span class=\\"token punctuation\\">=</span> <span class=\\"token string\\">\\"0.1.0\\"</span>\\n<span class=\\"token key property\\">authors</span> <span class=\\"token punctuation\\">=</span> <span class=\\"token punctuation\\">[</span><span class=\\"token string\\">\\"Alan Ram칤rez Herrera &lt;alan5142@hotmail.com>\\"</span><span class=\\"token punctuation\\">]</span>\\n<span class=\\"token key property\\">edition</span> <span class=\\"token punctuation\\">=</span> <span class=\\"token string\\">\\"2018\\"</span>\\n\\n<span class=\\"token comment\\"># See more keys and their definitions at https://doc.rust-lang.org/cargo/reference/manifest.html</span>\\n\\n<span class=\\"token punctuation\\">[</span><span class=\\"token table class-name\\">dependencies</span><span class=\\"token punctuation\\">]</span>\\n<span class=\\"token comment\\"># Aqu칤 van nuestras dependencias :)</span>\\n</code></pre>\\n<p>Es importante mencionar que estas <em>NO</em> son todas las opciones, Rust cuenta con documentaci칩n <a href=\\"https://doc.rust-lang.org/cargo/reference/manifest.html\\">para esto</a></p>\\n<ul>\\n<li><code>[package]</code> indica que inicia un paquete (proyecto)\\n<ul>\\n<li><code>name</code> es el nombre del paquete</li>\\n<li><code>verison</code> es la versi칩n del paquete</li>\\n<li><code>authors</code> es una lista de las personas que son consideradas autores del proyecto</li>\\n<li><code>edition</code> esta es importante, indica la edici칩n de Rust que se utilizar치, si no la especificamos por defecto utilizar치 2015 (la primera versi칩n estable)</li>\\n</ul>\\n</li>\\n<li><code>[dependencies]</code> contiene todas las dependencias que queramos utilizar en nuestro proyecto, podemos especificar de donde descargarlo (por ejemplo, un repositorio en GitHub) o utilizar <a href=\\"https://crates.io/\\">crates.io</a></li>\\n</ul>\\n<p>Para agregar dependencias basta con listarla debajo de <code>[dependencies]</code>, por ejemplo, si queremos instalar gfx (una API gr치fica), basta con hacer esto:</p>\\n<pre class=\\"language-toml\\"><code class=\\"language-toml\\"><span class=\\"token punctuation\\">[</span><span class=\\"token table class-name\\">dependencies</span><span class=\\"token punctuation\\">]</span>\\n<span class=\\"token key property\\">gfx</span> <span class=\\"token punctuation\\">=</span> <span class=\\"token string\\">\\"0.18.2\\"</span> <span class=\\"token comment\\"># Esta es la versi칩n</span>\\n</code></pre>\\n<p>춰Eso es todo!, compilamos nuestro programa y <code>cargo</code> buscar치 las nuevas dependencias y las instalar치, 쯡o es genial?</p>\\n<p>Ahora si, 쯫 c칩mo se ve un hola mundo?</p>\\n<pre class=\\"language-rust\\"><code class=\\"language-rust\\"><span class=\\"token keyword\\">fn</span> <span class=\\"token function\\">main</span><span class=\\"token punctuation\\">(</span><span class=\\"token punctuation\\">)</span> <span class=\\"token punctuation\\">{</span>\\n    <span class=\\"token function\\">println!</span><span class=\\"token punctuation\\">(</span><span class=\\"token string\\">\\"Hello world\\"</span><span class=\\"token punctuation\\">)</span><span class=\\"token punctuation\\">;</span>\\n<span class=\\"token punctuation\\">}</span>\\n</code></pre>\\n<p>Si queremos compilarlo utilizamos <code>cargo build</code> en la ra칤z del proyecto y si queremos ejecutarlo, utilizamos <code>cargo run</code>;\\nal compilarlo se crea una carpeta llamada <em>target</em>, ah칤 se encuentran los resultados de haber compilado nuestro programa</p>\\n<p>De aqu칤 podemos observar var칤as cosas:</p>\\n<ul>\\n<li>Las funciones inician con la palabra reservada <code>fn</code></li>\\n<li>Al igual que en C++, la funci칩n principal se llama <code>main</code></li>\\n<li>Se utilizan llaves para delimitar bloques</li>\\n<li>Para mostrar en pantalla, utilizamos <code>println!</code></li>\\n</ul>\\n<p>Rust tiene algunas otras diferencias comparado con otros lenguajes, pero son f치ciles de entender, veamos otro ejemplo.</p>\\n<pre class=\\"language-rust\\"><code class=\\"language-rust\\"><span class=\\"token keyword\\">fn</span> <span class=\\"token function\\">sentido_de_la_vida</span><span class=\\"token punctuation\\">(</span><span class=\\"token punctuation\\">)</span> <span class=\\"token punctuation\\">-></span> i32 <span class=\\"token punctuation\\">{</span>\\n    <span class=\\"token number\\">42</span>\\n<span class=\\"token punctuation\\">}</span>\\n\\n<span class=\\"token keyword\\">fn</span> <span class=\\"token function\\">main</span><span class=\\"token punctuation\\">(</span><span class=\\"token punctuation\\">)</span> <span class=\\"token punctuation\\">{</span>\\n    <span class=\\"token keyword\\">let</span> num <span class=\\"token operator\\">=</span> <span class=\\"token function\\">sentido_de_la_vida</span><span class=\\"token punctuation\\">(</span><span class=\\"token punctuation\\">)</span><span class=\\"token punctuation\\">;</span>\\n    <span class=\\"token keyword\\">if</span> num <span class=\\"token operator\\">!=</span> <span class=\\"token number\\">42</span> <span class=\\"token punctuation\\">{</span>\\n        <span class=\\"token function\\">println!</span><span class=\\"token punctuation\\">(</span><span class=\\"token string\\">\\"Oops, hay algo mal :(\\"</span><span class=\\"token punctuation\\">)</span><span class=\\"token punctuation\\">;</span>\\n    <span class=\\"token punctuation\\">}</span> <span class=\\"token keyword\\">else</span> <span class=\\"token punctuation\\">{</span>\\n        <span class=\\"token function\\">println!</span><span class=\\"token punctuation\\">(</span><span class=\\"token string\\">\\"Todo esta perfecto\\"</span><span class=\\"token punctuation\\">)</span><span class=\\"token punctuation\\">;</span>\\n    <span class=\\"token punctuation\\">}</span>\\n<span class=\\"token punctuation\\">}</span>\\n</code></pre>\\n<p>Efectuamos <code>cargo run</code> y mostrar치 lo siguiente (puedes verlo <a href=\\"https://play.rust-lang.org/?version=stable&amp;mode=debug&amp;edition=2018&amp;gist=206bf3a15a779ef8b8596d587a48179c\\">aqu칤</a>游녣)</p>\\n<pre class=\\"language-powershell\\"><code class=\\"language-powershell\\">Todo esta perfecto\\n</code></pre>\\n<h1 id=\\"thoughts\\">Mis opiniones</h1>\\n<h2>Lo bueno</h2>\\n<p>춰Rust es un lenguaje m치gnifico!, y no solo eso, viniendo de C++ la adopci칩n ha sido muy sencilla y creo que esto es un punto bastante fuerte del lenguaje,\\nquiz치 llega a ser un poco molesto la cantidad de veces que <code>rustc</code> no te permite compilar pero lo hace con mucha raz칩n: el compilador de rust\\nes uno de sus puntos m치s fuertes, los mensajes son muy claros, te indica d칩nde puede estar el error y posiblemente como solucionarlo y muchas\\nveces te impide realizar acciones que puedan suponer un riesgo (como utilizar una variable que ya ha sido movida), simplemente es una maravilla 游땙.</p>\\n<p>Adem치s, hay algunas cosas que me gustar칤a que C++ tuviera:</p>\\n<ul>\\n<li>Que los compiladores sean m치s amigables con los errores (especialmente con los errores del <em>linker</em> y con las templates)</li>\\n<li>Un g칠stor de paquetes (aunque lentamente la situaci칩n est치 mejorando con herramientas como <a href=\\"https://github.com/Microsoft/vcpkg\\">vcpkg</a> y <a href=\\"https://conan.io/\\">conan</a>)</li>\\n<li>Los traits :( (aunque los <em>Concepts</em> de C++20 pueden ayudar en esto)</li>\\n<li>춰Los tiempos de compilaci칩n!, cuando he utilizado <em>Boost</em>, espec칤ficamente Asio y Beast, los tiempos de compilaci칩n son exageradamente grandes (principalmente por culpa de las templates)</li>\\n</ul>\\n<h2>Lo malo</h2>\\n<p>Creo que es un lenguaje a칰n muy nuevo, falta que m치s proyectos lo utilicen de manera seria, pero estoy seguro de que esa situaci칩n cambiar치 en un futuro para bien</p>\\n<h2>Sin clasificar</h2>\\n<p>Creo que el lenguaje llego para quedarse, sin embargo, no creo que sustituya a C ni sea un <em>C++ killer</em>, creo que cada lenguaje tiene su espacio.</p>\\n<p>Y finalmente, creo que todos deber칤an probar Rust, pues creo que es un lenguaje moderno que demuestra que no se necesita un recolector de basura para\\nser seguro y, creo que ha hecho much칤simos aciertos en cuanto al dise침o de este.</p>\\n<br>\\n<br>\\nFinalmente, me gustar칤a saber, 쯧stedes ya han probado Rust?, 쯤u칠 opinan?, deja un comentario o env칤ame un mensaje.\\n<p>춰Hasta la pr칩xima!</p>\\n",\n    \n      meta: {"resourcePath":"C:\\\\Users\\\\alan2\\\\Documents\\\\proyectos\\\\alan-blog\\\\content\\\\blog\\\\2020-06-19-rust_getting_started.md"},\n     }//# sourceURL=[module]\n//# sourceMappingURL=data:application/json;charset=utf-8;base64,\n//# sourceURL=webpack-internal:///254\n')}}]);